                <div class="card-img-overlay d-flex flex-column justify-content-center">
                    <div className="container">
                        <h5 class="card-title display-3 fw-bolder mb-0">New Laptops Arrivals</h5>
                        <p class="card-text lead fs-2">Check out All The Newest</p>

                    </div>

                </div>
            </div>
            <Products />
        </div>

    );
}

